import React from 'react';
import ReactDOM from 'react-dom';

const App =() =>{
    window.navigator.geolocation().getCurrentposition(
        (position)=>console.log(postion),
        (err)=>consolelog(err)

    );
    return(
        <div>
            hi there....!
        </div>

    );
};

ReactDOM.render((<App />),document.querySelector('#root'));
